Here is a sample Spark job that calculates the hit rate for onsite attributed data:
```scala
import org.apache.spark.api.java.JavaRDD
import org.apache.spark.api.java.function.Function
import org.apache.spark.broadcast.Broadcast
import org.apache.spark.sql.SparkSession
import scala.collection.mutable.Map

object HitRateCalculator {
  def main(args: Array[String]): Unit = {
    val spark = SparkSession.builder().appName("HitRateCalculator").getOrCreate()

    // Load onsite attributed data
    val onsiteData: JavaRDD[String] = spark.read.textFile("onsite_data.txt").javaRDD()

    // Load top frequent queries
    val topQueries: JavaRDD[String] = spark.read.textFile("top_queries.txt").javaRDD()

    // Broadcast top queries to all nodes
    val broadcastTopQueries: Broadcast[Array[String]] = spark.sparkContext.broadcast(topQueries.collect())

    // Initialize cache
    val cache: Map[String, Long] = Map()

    // Process onsite data
    val hitRate = onsiteData.map(new Function[String, (String, Boolean)] {
      override def call(record: String): (String, Boolean) = {
        val query = record.split(" ")(0)
        val timestamp = record.split(" ")(1).toLong

        // Check if query is in top queries
        if (broadcastTopQueries.value.contains(query)) {
          // Check if query is in cache
          if (cache.contains(query)) {
            // Check if query is still in cache
            if (timestamp - cache(query) <= 12 * 60 * 60) {
              // Cache hit
              (query, true)
            } else {
              // Cache miss, update cache
              cache.put(query, timestamp)
              (query, false)
            }
          } else {
            // Cache miss, update cache
            cache.put(query, timestamp)
            (query, false)
          }
        } else {
          // Query not in top queries, ignore
          (query, false)
        }
      }
    }).filter(_._2).count() / onsiteData.count().toDouble

    println(s"Hit rate: $hitRate")

    spark.stop()
  }
}
```
This job first loads the onsite attributed data and top frequent queries from text files. It then broadcasts the top frequent queries to all nodes in the cluster. It initializes a cache to store the queries and their timestamps.

The job then processes the onsite attributed data by mapping each record to a tuple containing the query and a boolean indicating whether it was a cache hit or miss. If the query is in the top frequent queries and in the cache, and the timestamp is within 12 hours of the cached timestamp, it is a cache hit. Otherwise, it is a cache miss and the cache is updated with the new timestamp.

Finally, the job calculates the hit rate by dividing the number of cache hits by the total number of records in the onsite attributed data.

