To create a tooltip in NextJS using React Context to close the previously opened tooltip, you can follow these steps:

1. Create a Tooltip Context:

First, create a context for the tooltip component. This context will be used to manage the state of the tooltip and provide a way to close the previously opened tooltip.

```jsx
import React from 'react';

const TooltipContext = React.createContext();

export default TooltipContext;
```

2. Create a Tooltip Provider:

Next, create a provider component that will wrap the tooltip components and provide the context to them. This provider will manage the state of the tooltip and provide a way to close the previously opened tooltip.

```jsx
import React, { useState } from 'react';
import TooltipContext from './TooltipContext';

const TooltipProvider = ({ children }) => {
  const [activeTooltip, setActiveTooltip] = useState(null);

  const closeTooltip = () => {
    setActiveTooltip(null);
  };

  const openTooltip = (id) => {
    setActiveTooltip(id);
  };

  return (
    <TooltipContext.Provider value={{ activeTooltip, closeTooltip, openTooltip }}>
      {children}
    </TooltipContext.Provider>
  );
};

export default TooltipProvider;
```

3. Create a Tooltip Component:

Now, create a tooltip component that will use the context to manage its state and close the previously opened tooltip.

```jsx
import React, { useContext } from 'react';
import TooltipContext from './TooltipContext';

const Tooltip = ({ id, children }) => {
  const { activeTooltip, closeTooltip, openTooltip } = useContext(TooltipContext);

  const handleMouseEnter = () => {
    if (activeTooltip && activeTooltip !== id) {
      closeTooltip();
    }
    openTooltip(id);
  };

  const handleMouseLeave = () => {
    closeTooltip();
  };

  return (
    <div
      onMouseEnter={handleMouseEnter}
      onMouseLeave={handleMouseLeave}
    >
      {children}
      {activeTooltip === id && (
        <div className="tooltip">
          {/* Tooltip content goes here */}
        </div>
      )}
    </div>
  );
};

export default Tooltip;
```

4. Use the Tooltip Provider and Component:

Finally, use the tooltip provider and component in your NextJS application.

```jsx
import React from 'react';
import TooltipProvider from './TooltipProvider';
import Tooltip from './Tooltip';

const App = () => {
  return (
    <TooltipProvider>
      <div>
        <Tooltip id="tooltip1">
          Hover over me
        </Tooltip>
        <Tooltip id="tooltip2">
          Hover over me
        </Tooltip>
      </div>
    </TooltipProvider>
  );
};

export default App;
```

In this example, the `TooltipProvider` component wraps the `Tooltip` components and provides the context to them. The `Tooltip` component uses the context to manage its state and close the previously opened tooltip. When a tooltip is opened, it checks if there is an active tooltip and if it is not the same as the current tooltip, it closes the active tooltip before opening the current one.
